  return (
    <section id={"about-"+props.active+props.class} className={props.active===1?'about page active ':'about page'} >

   <div className={props.active === 0 ? 'project-section active page' : 'project-section page'} >
<MemoryGame {...props}/>
   </div>
   </section>
  );
}
